import { mapKeys } from './utils';

function transformUserKeys(user) {
  return mapKeys(function (key) {
    return key.toLowerCase();
  }, user);
}

export function getCurrentUser() {
  return fetch('/api/me').then(function (response) {
    return response.json();
  }).then(transformUserKeys, function () {
    return null;
  });
}
export function getUserList() {
  return fetch('/api/users').then(function (response) {
    return response.json();
  }).then(function (data) {
    return data.ids.map(function (id) {
      return data.users[id];
    }).filter(Boolean).map(transformUserKeys);
  }, function () {
    return [];
  });
}

