import { formatDate } from './utils';
export function renderUser(user) {
  if (!user) {
    user = {
      name: 'Unknown User',
      avatar: '/img/default-avatar.png',
      birthday: 0,
      role: 'Unknown'
    };
  }

  var birthday = new Date(user.birthday);
  return "<section>\n    <header>\n      <img src=\"".concat(user.avatar, "\">\n      <h2>").concat(user.name, "</h2>\n    </header>\n    <dl>\n      <dt>Birthday</dt>\n      <dd><time datetime=\"").concat(birthday.toISOString(), "\">").concat(formatDate(birthday), "</time></dd>\n      <dt>Role</dt>\n      <dd>").concat(user.role, "</dd>\n    </dl>\n  </section>");
}
export function renderUserList(users) {
  if (!users || !users.length) {
    return '<section>No users</section>';
  }

  return "<section>\n    <header>Users</header>\n    <ul>\n      ".concat(users.map(renderUser).join('\n'), "\n    </ul>\n  </section>");
}

